import './components/css/app.css';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import Welcome from './components/Welcome';
import Pick from './components/Pick';

function App() {
  return (
    <div className="wrapper">
          <Route exact path='/'>
            <Welcome />
          </Route>
          <Route path='/pick'>
            <Pick />
          </Route>
    </div>
  );
}

export default App;
